Russian-Made M44 carbine w/integrated fold out bayonet.  Fires the powerful and plentiful 7.62x54r round.  Has some light wear on the finish.  Bore is clean.   I'm sure most people are familiar with this already but if not -->  http://www.youtube.com/watch?v=o4EB1H9sbNQ&a mp;n bsp;


I'd be interested in a gen 2 lcp or other interesting trades.  Other things I might be interested in - an 8-rd pm makarov, 18.5 in mossberg (but would want one with the matte receiver not blued), takedown 10/22.  Not interested in hi point, jimenez, bryco, raven etc. or single barrel shotguns.


FLDL and CWP required.  I have CWP and will do BOS.
